John Leslie's Dog Walker (1994 Evil Angel) [DVDRip]

CAST
Alex Sanders, Christina Angel, Gerry Pike, Isis Nile, Jake Williams, Jamie Gillis, Jay Ashley, Joey Silvera, Jon Dough, Julian St. Jox, Kristi Lynn, Maeva, Steven St. Croix, Tom Byron

John Leslie's Dog Walker: Walking the edge, the excitement, the fear The arousal! - The rush of life. But where does it all lead? Who's Waiting? Steven St. Croix is a man on the edge. But he's used up all his margin for safety. All that's left is the cutting, the torture, the pain. Christina Angel, an exquisite angelic beauty, Krysti Lynn dishing out the tease/torture like only she can, and Isis Nile as the temptress of the night. Are they all demons on the battlefield of his soul?

